import { useState } from "react";
import {
  View,
  Text,
  Image,
  StyleSheet,
  TextInput,
  TouchableOpacity,
} from "react-native";
import { createBottomTabNavigator } from "@react-navigation/bottom-tabs";

const Tab = createBottomTabNavigator();

const Home: React.FC<{}> = () => {
  const { container, topImage, formContainer } = styles;

  return (
    <Tab.Navigator>
      <Tab.Screen name="Home" component={() => <p>home</p>} />
      <Tab.Screen name="Settings" component={() => <p>settings</p>} />
    </Tab.Navigator>
  );
};

const styles = StyleSheet.create({});

export default Home;
